  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'
  import '../../styles/scss/theme.scss';
import t from '../../i18n';
import { PropsTable, Playground } from 'docz'
import Layout from '../src';
import styled from 'styled-components';

export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}>
<MDXTag name="h1" components={components} props={{"id":"layout"}}><MDXTag name="strong" components={components} parentName="h1">{`Layout`}</MDXTag></MDXTag>

<PropsTable of={Layout} />
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{"className":"language-jsx","metastring":null}}>{`    import Layout, { SideMenu, Topbar } from '@nimbos/layout';

    <Layout>
        <Layout.Topbar>
            <Topbar>
                <Topbar.Left> 
                    I\`m a left content
                </Topbar.Left>
            </Topbar>
        </Layout.Topbar>
        <Layout.Sidebar>
            <SideMenu>
                    <SideMenu 
                        onMenuToggle={this.handleToggleMenu}
                        onPinToggle={this.handlePinMenu}
                        onOverlayClick={this.handleOverlayClick}
                        open={menuOpen}
                        pinned={pinned}
                    >
                    <SideMenu.Header iconMenu="fa fa-bars" iconPin="fas fa-thumbtack" />
                    <SideMenu.List onSelect={this.handleMenuSelected} items={menuItems} />
                </SideMenu>
            </SideMenu>
        </Layout.Sidebar>
        <Layout.Container>
            I'm a Content
        </Layout.Container>
    </Layout>
`}</MDXTag></MDXTag>
           </MDXTag>
  }
}
